            <style>
                 body {
                    font-family: Arial, sans-serif;
                    margin: 0;
                    padding: 0;
                    background-color: #f4f4f9;
                    height: 100vh;
                    display: flex;
                    flex-direction: column;
                    justify-content: space-between;
                }
                header {
                    background-color: #ffffff;
                    color: black;
                    padding: 20px;
                    text-align: center;
                    box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
                    position: sticky;
                    top: 0;
                    width: 100%;
                    bottom: auto;
                }
                main {
                    flex-grow: 1;
                    margin: 20px auto;
                    padding: 20px;
                    background: white;
                    box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.1);
                }
                h1, h2 {
                    color: #333;
                }
                .section {
                    margin-bottom: 30px;
                }
                .image-comparison {
                    display: flex;
                    justify-content: space-between;
                }
                .image-container {
                    text-align: center;
                    max-width: 48%;
                }
                #image-container-data{ 
                    text-align: center;
                    margin: 0 auto;
                    display: block;
                    width: fit-content;
                }
                img {
                    max-width: 100%;
                    border-radius: 5px;
                }
                .progress-bar-container {
                    margin: 20px 0;
                    width: 100%;
                    background: #e0e0e0;
                    border-radius: 10px;
                    overflow: hidden;
                }
                .progress-bar {
                    height: 20px;
                    line-height: 20px;
                    color: white;
                    text-align: center;
                    border-radius: 10px;
                    transition: width 0.5s;
                }
                .green { background: #28a745; }
                .yellow { background: #ffc107; }
                .orange { background: #fd7e14; }
                .red { background: #dc3545; }
                table {
                    width: 100%;
                    border-collapse: collapse;
                    margin-top: 20px;
                }
                table, th, td {
                    border: 1px solid #ddd;
                }
                th, td {
                    padding: 10px;
                    text-align: left;
                }
                th {
                    background-color: #f4f4f9;
                }
                footer {
                    text-align: center;
                    color: #777;
                    margin-top: 30px;
                    padding: 10px;
                    background: #f1f1f1;
                }
                .diff-image {
                    display: block; 
                    margin: 0 auto;
                }
            </style>
